import React from 'react';
import uuid from 'uuid';
import { Button, Card, CardHeader, CardBody, FormGroup, Form, Input, Row, Col } from "reactstrap";
import { Link } from 'react-router-dom';

const item = (props) => {


  const element = props.variables;

  return (

    <tr key={uuid()}>
      <th key={(element._id)} className="text-right">
        {(element.nombre)}
      </th>

      <th key={(element._id)} className="text-right">
        {(element.correo)}
      </th>

      <th key={(element._id)} className="text-right">
        {(element.canton)}
      </th>

      <th key={(element._id)} className="text-right">
        {(element.provincia)}
      </th>
      <th>
        <Link

          className="text-reset text-decoration-none"
          // to={`/badges/${badge.id}/edit`}
          to={`/user-page/${element._id}`}

        >
        </Link>
        {/* <Button className="ml-1" outline color="info" size="sm">Edit</Button> */}
        {/* <Button className="ml-1" outline color="danger" size="sm">Remove</Button> */}
        <Link

          className="text-reset text-decoration-none"
          // to={`/badges/${badge.id}/edit`}
          to={`/user-page/${element._id}`}
        >
        </Link>
      </th>
    </tr>


  )
};

export default item;
